import { Route, Switch } from "react-router-dom";
import AllQuotes from "./pages/AllQuotos";
import NewQuote from "./pages/NewQuote";
import QuateDetail from "./pages/QuoteDetail";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/quotes"></Route>
        <Route path="/quotes/:quoteId"></Route>
      </Switch>
      <Route path="/new-quote"></Route>
      <AllQuotes />
      <NewQuote />
      <QuateDetail />
    </div>
  );
}

export default App;
